import React from 'react';
import './App.css';
import styled from 'styled-components';

import Block from './components/Block'

class App extends React.Component{
  render() {
    return (
      <StyledApp>
        <Block/>
      </StyledApp>
    );
  }
}

export default App;

const StyledApp = styled.div`
  display: flex;
  flex-wrap: wrap;
  background: #61dafb;
  width: 300px;
  height: 720px;
`
